import React, {Component} from 'react';
import Header from './Page/Header';
import MenuUtama from './Page/MenuUtama';
import MenuMakanan from './Page/MenuMakanan';
import Footer from './Page/Footer';

class App extends Component {
  render(){
    return(
        <div>
            <Header />
            <MenuUtama />
            <MenuMakanan />

            <MenuTentangKami />
            <MenuKontak />
            <Footer />
        </div>
    );
  }
}
export default App;
